HQ very rare promo music video from a promo DVD. &quot;Where Have All the Good Times Gone&quot; is a song written by Ray Davies and performed with The Kinks. It was first released as the B-side to &quot;Till the End of the Day,&quot; and was then included on their album The Kink Kontroversy in 1965 (1966 in the US).

The song has since gained &quot;classic&quot; status and featured on numerous compilations. It was covered by David Bowie on the album Pin Ups, after which Pye Records released the track as a single in November 1973 (Pye 7N 45313 b/w &quot;Lola&quot;). This re-release failed to chart.

It has also been covered by Van Halen in the album Diver Down. This was Van Halen's second cover of a Kinks' song, the first being You Really Got Me on their eponymous debut album.

The Kinks were an English rock band formed in Muswell Hill, North London, by brothers Ray and Dave Davies in 1964. Categorised in the United States as a British Invasion band, the Kinks are recognised as one of the most important and influential rock groups of the era.

Their music was influenced by a wide range of genres, including rhythm and blues, British music hall, folk and country. Ray Davies (lead vocals, rhythm guitar) and Dave Davies (lead guitar, vocals) remained members throughout the group's 32-year run.

The Kinks had five Top 10 singles on the US Billboard chart. Nine of their albums charted in the Top 40. In the UK, the group had seventeen Top 20 singles and five Top 10 albums. Four of their albums have been certified gold by the RIAA. Among numerous honours, they received the Ivor Novello Award for &quot;Outstanding Service to British Music&quot;. In 1990, their first year of eligibility, the original four members of The Kinks were inducted into the Rock &amp; Roll Hall of Fame, as well as the UK Music Hall of Fame in November 2005.
